sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.first_name != "")
		outputs.first_name = inputs.first_name;
	else
		var first_name = new FirstAdvantageSpokeUtils().validateUserName(
			inputs.first_name);

	if (inputs.last_name != "")
		outputs.last_name = inputs.last_name;
	else
		var last_name = new FirstAdvantageSpokeUtils().validateUserLastName(
			inputs.last_name);

	if (inputs.email != "")
		outputs.email = inputs.email;
	else
		var email = new FirstAdvantageSpokeUtils().validateUserEmail(inputs
			.email);

	if (inputs.phone != "")
		outputs.phone = inputs.phone;
	else
		var phone = new FirstAdvantageSpokeUtils().validateUserPhone(inputs
			.phone);

	outputs.user_id = inputs.user_id;
	outputs.account = inputs.account;
	outputs.middle_name = inputs.middle_name;
	outputs.root_account = inputs.root_account;
	outputs.profile = inputs.profile;
	outputs.sso_client_name = inputs.sso_client_name;
	outputs.sso_client_user = inputs.sso_client_user;
	outputs.client_ip = inputs.client_ip;
	outputs.roles = inputs.roles;
	if (inputs.deactivate == true) {
		outputs.deactivate = "false";
	}
	else {
		outputs.deactivate = "true";
	}
	if (inputs.registration_date) {
		var str = inputs.registration_date;
		var res = str.split(" ");
		outputs.registration_date = res[0] + "T" + res[1];
	}

})(inputs, outputs);

